import React from "react";
import Dialog from "@material-ui/core/dialog";
import DialogContent from "@material-ui/core/dialogContent";
import DialogActions from "@material-ui/core/DialogActions";
import { Button, Typography } from "@material-ui/core";

const ConfirmDialog = (props) => {
  const {
    isOpen = false,
    onClose = () => {},
    title = "",
    subtitle = "",
    onConfirm,
  } = props;

  const handleClose = (event) => {
    onClose(event);
  };

  return (
    <Dialog
      title={title}
      subtitle={subtitle}
      open={isOpen}
      onClose={handleClose}
      onClick={onConfirm}
    >
      <DialogContent>
        <Typography
          color="primary"
          gutterBottom
          variant="subtitle1"
          component="h6"
        >
          {title}
        </Typography>
        <Typography
          color="primary"
          gutterBottom
          variant="subtitle2"
          component="h6"
        >
          {subtitle}
        </Typography>
      </DialogContent>
      <DialogActions>
        <Button>Non</Button>
        <Button>Oui</Button>
      </DialogActions>
    </Dialog>
  );
};

export default ConfirmDialog;
